);
If(
    (global_acesso_corrente = const_acesso_corrente_gestor),
    If(
        IsBlankOrError(text_9_o_que_a_empresa_espera.Text),
        Collect(
            colecao_erros_mapa,
            LookUp(
                colecao_mensagens_mapa,
                idioma = global_idioma
            ).campo_obrigatorio & label_9_o_que_a_empresa_espera.Text
        )
    )
);
If(
    IsBlankOrError(text_11_acoes_alinhadas.Text),
    Collect(
        colecao_erros_mapa,
        LookUp(
            colecao_mensagens_mapa,
            idioma = global_idioma
        ).campo_obrigatorio & label_11_acoes_alinhadas.Text
    )
);
If(
    CountRows(colecao_erros_mapa) = 0,
    If(
        fez_assinatura_gestor And !IsBlankOrError(id_mapa_existente),
        UpdateIf(
            Mapa,
            ID = id_mapa_existente,
            {
                AceiteGestor: mapa_check_assinatura_gestor.Value,
                AssinaturaGestor: mapa_label_assinatura_gestor.Text,
                StatusNovo: If(
                    IsBlankOrError(mapa_existente.AssinaturaColaborador),
                    LookUp(
                        colecao_status,
                        idioma = mapa_existente.IdiomaNovo
                    ).status_feedback_aguardando_assinatura_colaborador,
                    LookUp(
                        colecao_status,
                        idioma = mapa_existente.IdiomaNovo
                    ).status_feedback_finalizado
                ),
                MetaCarreira: text_1_meta_carreira.Text,
                AtividadeMaisEnergiza: text_2_atividade_mais_energiza.Text,
                AtividadeMenosEnergiza: text_3_atividade_menos_energiza.Text,
                Autoavaliacao: text_5_o_que_tem_de_bom.Text,
