                CicloNovo: global_ciclo,
                Ciclo: global_ciclo
            }
        )
    );
    If(
        fez_assinatura_colaborador And !IsBlankOrError(id_mapa_existente),
        UpdateIf(
            Mapa,
            ID = id_mapa_existente,
            {
                AceiteColaborador: mapa_check_assinatura_colaborador.Value,
                AssinaturaColaborador: mapa_label_assinatura_colaborador.Text,
                StatusNovo: If(
                    IsBlankOrError(mapa_existente.AssinaturaGestor),
                    LookUp(
                        colecao_status,
                        idioma = mapa_existente.IdiomaNovo
                    ).status_feedback_aguardando_assinatura_gestor,
                    LookUp(
                        colecao_status,
                        idioma = mapa_existente.IdiomaNovo
                    ).status_feedback_finalizado
                ),
                MetaCarreira: text_1_meta_carreira.Text,
                AtividadeMaisEnergiza: text_2_atividade_mais_energiza.Text,
                AtividadeMenosEnergiza: text_3_atividade_menos_energiza.Text,
