                CicloNovo: global_ciclo,
                Ciclo: global_ciclo
            }
        )
    );
    If(
        (!fez_assinatura_colaborador And !fez_assinatura_gestor) And !IsBlankOrError(id_mapa_existente),
        UpdateIf(
            Mapa,
            ID = id_mapa_existente,
            {
                MetaCarreira: text_1_meta_carreira.Text,
                AtividadeMaisEnergiza: text_2_atividade_mais_energiza.Text,
                AtividadeMenosEnergiza: text_3_atividade_menos_energiza.Text,
                Autoavaliacao: text_5_o_que_tem_de_bom.Text,
                Percepcao: text_7_o_que_outros_diriam.Text,
                AlvoFuturo: text_9_o_que_a_empresa_espera.Text,
                PlanoAcao: text_11_acoes_alinhadas.Text,
                //EmailColaborador: global_colaborador_email;
                //EmailGestor: global_email_gestor;
                Ano: global_ciclo_ano,
                CicloNovo: global_ciclo,
                Ciclo: global_ciclo
            }
        )
    );
    If(
        IsBlankOrError(id_mapa_existente),
        Patch(
            Mapa,
            Defaults(Mapa),
            {
                Cargo: local_cargo,
                Diretoria: local_diretoria,
                Secao: local_secao,
                MetaCarreira: text_1_meta_carreira.Text,
                AtividadeMaisEnergiza: text_2_atividade_mais_energiza.Text,
                AtividadeMenosEnergiza: text_3_atividade_menos_energiza.Text,
                Autoavaliacao: text_5_o_que_tem_de_bom.Text,
                Percepcao: text_7_o_que_outros_diriam.Text,
                AlvoFuturo: text_9_o_que_a_empresa_espera.Text,
                PlanoAcao: text_11_acoes_alinhadas.Text,
                EmailColaborador: global_colaborador_email,
                EmailGestor: global_email_gestor,
                Ano: global_ciclo_ano,
                StatusNovo: If(
                    mapa_check_assinatura_gestor.Value = true,
                    LookUp(
