                    LookUp(
                        colecao_status,
                        idioma = global_idioma
                    ).status_feedback_rascunho
                ),
                IdiomaNovo: global_idioma,
                CicloNovo: global_ciclo,
                Ciclo: global_ciclo,
                AceiteGestor: mapa_check_assinatura_gestor.Value,
                AssinaturaGestor: mapa_label_assinatura_gestor.Text,
