        IsEmpty(Errors(Mapa)),
        Refresh(Mapa);
        ClearCollect(
            colecao_mapa,
            Filter(
                Mapa,
                EmailColaborador = global_colaborador_email And Ano = global_ciclo_ano
            )
        );
        If(
            global_ciclo = const_ciclo_1,
            UpdateContext(
                {
                    id_mapa_existente: LookUp(
                        colecao_mapa,
                        IsMatch(
                            CicloNovo,
                            "1",
                            Contains
