                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_2,
            UpdateContext(
                {
                    id_mapa_existente: LookUp(
                        colecao_mapa,
                        IsMatch(
                            CicloNovo,
                            "2",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_3,
            UpdateContext(
                {
                    id_mapa_existente: LookUp(
                        colecao_mapa,
                        IsMatch(
                            CicloNovo,
                            "3",
                            Contains
                        )
                    ).ID
                }
            )
        );
        If(
            global_ciclo = const_ciclo_4,
            UpdateContext(
                {
                    id_mapa_existente: LookUp(
                        colecao_mapa,
                        IsMatch(
                            CicloNovo,
                            "4",
                            Contains
                        )
                    ).ID
                }
            )
        );
