    If(
        global_ciclo = const_ciclo_3,
        UpdateContext(
            {
                id_mapa_existente: LookUp(
                    colecao_mapa,
                    IsMatch(
                        CicloNovo,
                        "3",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        global_ciclo = const_ciclo_4,
        UpdateContext(
            {
                id_mapa_existente: LookUp(
                    colecao_mapa,
                    IsMatch(
                        CicloNovo,
                        "4",
                        Contains
                    )
                ).ID
            }
        )
    );
    If(
        !IsBlankOrError(id_mapa_existente),
        UpdateContext(
            {
                feedback_existente: First(
                    Filter(
                        colecao_mapa,
                        ID = id_mapa_existente
                    )
                )
            }
        )
    );
    Notify(
        "Success",
        NotificationType.Success
    ),
    Notify(
        First(Errors(Mapa)).Message,
        NotificationType.Error
